import React, { useState } from 'react';

const Projects = () => {
  const [activeFilter, setActiveFilter] = useState('all');

  const projects = [
    {
      id: 1,
      title: "Personal Portfolio Website",
      description: "A responsive portfolio website built with React.js and Tailwind CSS to showcase my skills, education, and projects.",
      image: "https://via.placeholder.com/400x250/3B82F6/FFFFFF?text=Portfolio",
      technologies: ["React.js", "Tailwind CSS", "JavaScript"],
      category: "web",
      liveUrl: "#",
      githubUrl: "#"
    },
    {
      id: 2,
      title: "Student Management System",
      description: "A web application for managing student records, attendance, and grades, built with Node.js and SQL.",
      image: "https://via.placeholder.com/400x250/10B981/FFFFFF?text=Student+Mgmt",
      technologies: ["Node.js", "SQL", "Express"],
      category: "web",
      liveUrl: "#",
      githubUrl: "#"
    },
    {
      id: 3,
      title: "Weather App",
      description: "A simple weather app that fetches and displays weather data using a public API.",
      image: "https://via.placeholder.com/400x250/F59E0B/FFFFFF?text=Weather+App",
      technologies: ["JavaScript", "HTML", "CSS"],
      category: "web",
      liveUrl: "#",
      githubUrl: "#"
    },
    {
      id: 4,
      title: "To-Do List",
      description: "A basic to-do list application to manage daily tasks, built with React.js.",
      image: "https://via.placeholder.com/400x250/8B5CF6/FFFFFF?text=To-Do+List",
      technologies: ["React.js", "CSS"],
      category: "web",
      liveUrl: "#",
      githubUrl: "#"
    },
    {
      id: 5,
      title: "Calculator App",
      description: "A simple calculator app built using HTML, CSS, and JavaScript.",
      image: "https://via.placeholder.com/400x250/EF4444/FFFFFF?text=Calculator",
      technologies: ["HTML", "CSS", "JavaScript"],
      category: "web",
      liveUrl: "#",
      githubUrl: "#"
    }
  ];

  const filters = [
    { id: 'all', label: 'All Projects' },
    { id: 'web', label: 'Web Development' },
    { id: 'mobile', label: 'Mobile Apps' },
    { id: 'ai', label: 'AI/ML' }
  ];

  const filteredProjects = activeFilter === 'all' 
    ? projects 
    : projects.filter(project => project.category === activeFilter);

  return (
    <section id="projects" className="py-20 bg-white">
      <div className="container mx-auto px-4">
        <div className="text-center mb-16">
          <h2 className="text-4xl font-bold text-gray-800 mb-4">My Projects</h2>
          <p className="text-gray-600 max-w-2xl mx-auto">
            Here are some of the projects I've worked on. Each project represents a unique challenge 
            and learning experience.
          </p>
        </div>

        {/* Filter Buttons */}
        <div className="flex justify-center mb-12">
          <div className="flex flex-wrap gap-4">
            {filters.map((filter) => (
              <button
                key={filter.id}
                onClick={() => setActiveFilter(filter.id)}
                className={`px-6 py-2 rounded-full font-medium transition-colors ${
                  activeFilter === filter.id
                    ? 'bg-primary text-white'
                    : 'bg-gray-200 text-gray-700 hover:bg-gray-300'
                }`}
              >
                {filter.label}
              </button>
            ))}
          </div>
        </div>

        {/* Projects Grid */}
        <div className="grid md:grid-cols-2 lg:grid-cols-3 gap-8">
          {filteredProjects.map((project) => (
            <div key={project.id} className="bg-white rounded-lg shadow-lg overflow-hidden hover:shadow-xl transition-shadow">
              <div className="relative">
                <img 
                  src={project.image} 
                  alt={project.title}
                  className="w-full h-48 object-cover"
                />
                <div className="absolute top-4 right-4">
                  <span className="bg-primary text-white px-3 py-1 rounded-full text-sm font-medium">
                    {project.category.toUpperCase()}
                  </span>
                </div>
              </div>
              
              <div className="p-6">
                <h3 className="text-xl font-semibold text-gray-800 mb-3">
                  {project.title}
                </h3>
                <p className="text-gray-600 mb-4 leading-relaxed">
                  {project.description}
                </p>
                
                <div className="mb-4">
                  <div className="flex flex-wrap gap-2">
                    {project.technologies.map((tech, index) => (
                      <span 
                        key={index}
                        className="bg-gray-100 text-gray-700 px-3 py-1 rounded-full text-sm"
                      >
                        {tech}
                      </span>
                    ))}
                  </div>
                </div>
                
                <div className="flex gap-4">
                  <a 
                    href={project.liveUrl}
                    className="flex-1 bg-primary text-white text-center py-2 rounded-lg hover:bg-blue-600 transition-colors"
                  >
                    Live Demo
                  </a>
                  <a 
                    href={project.githubUrl}
                    className="flex-1 bg-gray-200 text-gray-700 text-center py-2 rounded-lg hover:bg-gray-300 transition-colors"
                  >
                    GitHub
                  </a>
                </div>
              </div>
            </div>
          ))}
        </div>

        {/* Call to Action */}
        <div className="text-center mt-16">
          <p className="text-gray-600 mb-6">
            Interested in working together? Let's discuss your project!
          </p>
          <a 
            href="#contact"
            className="bg-primary text-white px-8 py-3 rounded-lg hover:bg-blue-600 transition-colors"
          >
            Get In Touch
          </a>
        </div>
      </div>
    </section>
  );
};

export default Projects;
